int dp[2][32][32][32][32];
int mod=1000000009;

void solve(int n,int h) {
    int cur=0,next=1,k=0;
    memset(dp,0,sizeof(dp));
    dp[cur][0][0][0][0]=1;
    for(int i=0;i<n;++i) {
        ++k;
        for(int a=0;a<=h;++a)
            for(int b=0;b<=h;++b)
                for(int c=0;c<=h;++c)
                    for(int d=0;d<=h;++d) {
                        if (dp[cur][a][b][c][d]) {
                            int na=min(h,a+1),nb=min(h,b+1),nc=min(h,c+1),nd=min(h,d+1);
                            dp[next][a==h ? a : 0][nb][nc][nd]+=dp[cur][a][b][c][d];
                            if (dp[next][a==h ? a : 0][nb][nc][nd]>=mod)
                                dp[next][a==h ? a : 0][nb][nc][nd]-=mod;
                            dp[next][na][b==h ? b : 0][nc][nd]+=dp[cur][a][b][c][d];
                            if (dp[next][na][b==h ? b : 0][nc][nd]>=mod)
                                dp[next][na][b==h ? b : 0][nc][nd]-=mod;
                            dp[next][na][nb][c==h ? c : 0][nd]+=dp[cur][a][b][c][d];
                            if (dp[next][na][nb][c==h ? c : 0][nd]>=mod)
                                dp[next][na][nb][c==h ? c : 0][nd]-=mod;
                            dp[next][na][nb][nc][d==h ? d : 0]+=dp[cur][a][b][c][d];
                            if (dp[next][na][nb][nc][d==h ? d : 0]>=mod)
                                dp[next][na][nb][nc][d==h ? d : 0]-=mod;
                        }
                    }
        memset(dp[cur],0,sizeof(dp[cur]));
        cur^=1; next^=1;
        int ans=0;
        for(int a=0;a<=h;++a)
            for(int b=0;b<=h;++b)
                for(int c=0;c<=h;++c)
                    for(int d=0;d<=h;++d) {
                        if (a==h&&b==h&&c==h&&d==h) continue;
                        ans+=dp[cur][a][b][c][d];
                        if (ans>=mod) ans-=mod;
                    }
        if (k>335) cout << ans << ",";
    }
}

int go(int n,int h) {
    int cur=0,next=1;
    dp[cur][0][0][0][0]=1;
    for(int i=0;i<n;++i) {
        for(int a=0;a<=h;++a)
            for(int b=0;b<=h;++b)
                for(int c=0;c<=h;++c)
                    for(int d=0;d<=h;++d) {
                        if (dp[cur][a][b][c][d]) {
                            int na=min(h,a+1),nb=min(h,b+1),nc=min(h,c+1),nd=min(h,d+1);
                            dp[next][a==h ? a : 0][nb][nc][nd]+=dp[cur][a][b][c][d];
                            if (dp[next][a==h ? a : 0][nb][nc][nd]>=mod)
                                dp[next][a==h ? a : 0][nb][nc][nd]-=mod;
                            dp[next][na][b==h ? b : 0][nc][nd]+=dp[cur][a][b][c][d];
                            if (dp[next][na][b==h ? b : 0][nc][nd]>=mod)
                                dp[next][na][b==h ? b : 0][nc][nd]-=mod;
                            dp[next][na][nb][c==h ? c : 0][nd]+=dp[cur][a][b][c][d];
                            if (dp[next][na][nb][c==h ? c : 0][nd]>=mod)
                                dp[next][na][nb][c==h ? c : 0][nd]-=mod;
                            dp[next][na][nb][nc][d==h ? d : 0]+=dp[cur][a][b][c][d];
                            if (dp[next][na][nb][nc][d==h ? d : 0]>=mod)
                                dp[next][na][nb][nc][d==h ? d : 0]-=mod;
                        }
                    }
        memset(dp[cur],0,sizeof(dp[cur]));
        cur^=1; next^=1;
    }
    int ans=0;
    for(int a=0;a<=h;++a)
        for(int b=0;b<=h;++b)
            for(int c=0;c<=h;++c)
                for(int d=0;d<=h;++d) {
                    if (a==h&&b==h&&c==h&&d==h) continue;
                    ans+=dp[cur][a][b][c][d];
                    if (ans>=mod) ans-=mod;
                }
    return ans;
}

